    [],nt"revision_timestamp": "2015-01-22T15:57:47.450748",nt"name": "hud-low-and-moderate-income-areas",nt"isopen":
    false,nt"url": null,nt"notes": "This dataset and map service provides information
    on the U.S. Housing and Urban Development's (HUD) low to moderate income areas.
    The term Low to Moderate Income, often referred to as low-mod, has a specific programmatic
    context within the Community Development Block Grant (CDBG) program. Over a 1, 2,
    or 3-year period, as selected by the grantee, not less than 70 percent of CDBG funds
    must be used for activities that benefit low- and moderate-income persons. HUD uses
    special tabulations of Census data to determine areas where at least 51% of households
    have incomes at or below 80% of the area median income (AMI). This dataset and map
    service contains the following layer.",nt"license_title": "License Not Specified",nt"extras":
